import React from "react";
import Proptypes from "prop-types";
import styled from "styled-components";

const todayWrapper = styled.div`
  margin: 10px;
`;

const Today = ({ today }) => {
  return (
    <todayWrapper>
      <div>Today`s Schedule</div>
      <div>{today}</div>
    </todayWrapper>
  );
};

Today.proptypes = {
  today: Proptypes.string.isRequired,
};

export default Today;
